import React from 'react';
import styled from 'styled-components'



const Wrap = styled.div `
    display: flex;
    justify-content: center;
    width: 60%
    height: 30
`

const Projects = () => {
    return ( 
        <Wrap>
            <img src="/project.gif" alt="project game of life" />
        </Wrap>
     );
}

export default Projects;
